import React, { Component } from "react";
import "./assignments.scss";
import Assignmentbox from "./assignmentbox/assignmentbox";
import QuizBox from "./quizbox/quixbox";
import assignmentData from "../../jsonData/assignments.json";


const Assignments = () => {
  const assignments = assignmentData.assignments;
  const quizes = assignmentData.quiz;

  return (
    <section>
      <div className="assignments">
        <h1>Assignments</h1>
        <div className="assignmentboxes">
          {
            assignments.map((assignment) => (
				      <Assignmentbox assignment={assignment.title} corrected={assignment.corrected}
                  submitted={assignment.submitted} passed={assignment.passed} info={assignment.information}
                  duration={assignment.duration}/>
            ))
          }
        </div>
      </div>

      <div className="quizes">
          <h1>Quiz and Tests</h1>
          <div className="quizboxes">
            {
              quizes.map((quiz) => (
				         <QuizBox quizName={quiz.quizName} submitted={quiz.submitted} progress={quiz.precentPassed}/>
              ))
            }
          </div>
      </div>

    </section>
  );
};


export default Assignments;
